import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import { connect } from 'react-redux';
//import { registerUser } from '../actions/authActions';
import { Button, Form } from 'react-bootstrap';
import classnames from 'classnames';


class Register extends Component {
    constructor() {
        super();
        this.state = {
          name: '',
          email: '',
          password: '',
          password2: '',
          errors: {}
        };
      }

    componentDidUpdate(nextProps) {
      if (nextProps.errors) {
        this.setState({
          errors: nextProps.errors
        });
      }
    }

    onChange = e => {
        this.setState({ [e.target.id]: e.target.value });
      };
    onSubmit = e => {
        e.preventDefault();

        const newUser = {
              name: this.state.name,
              email: this.state.email,
              password: this.state.password,
              password2: this.state.password
        };

        this.props.registerUser(newUser, this.props.history)
        };

    render() {
        const { errors } = this.state;
        return (
            <Form onSubmit={this.onSubmit}>
            <Form.Group controlId='name'>
                <Form.Label>Name</Form.Label>
                <Form.Control value={this.state.name} onChange={this.onChange} type='text' id='name' error={errors.name} placeholder='Enter name' />
            </Form.Group>
            <Form.Group controlId="email">
                <Form.Label>Email address</Form.Label>
                <Form.Control value={this.state.email} onChange={this.onChange} type="email" id='email' error={errors.email} placeholder="Enter email" />
            </Form.Group>
            <Form.Group controlId="password">
                <Form.Label>Password</Form.Label>
                <Form.Control value={this.state.password} onChange={this.onChange} type="password" id='password' error={errors.password} placeholder="Password" />
            </Form.Group>
            <Form.Group controlId="password2">
                <Form.Label>Confirm Password</Form.Label>
                <Form.Control value={this.state.password2} onChange={this.onChange} type="password" id='password2' error={errors.password2} placeholder="Password" />
            </Form.Group>
            <Button variant="primary" type="submit">
              Submit
            </Button>
          </Form>
        )
    }
}


export default Register;
